import React, {useState, useEffect} from 'react';
import clsx from 'clsx';
import {makeStyles} from '@material-ui/core/styles'
import GridProjectSellLeases from '../../GridList/GridAdSellLeases'

const useStyles = makeStyles(theme => ({
    root: {},
    title: {
        color: "gray"
    },
    posts: {
        marginTop: theme.spacing(2)
    },
    post: {
        marginBottom: theme.spacing(2)
    }
}));

interface ListProjectProps {
    className ?: string,
}

interface ProjectProps  {
    node: {
        title: string,
        slug: string,
        created_at: string,
        updated_at: string,
        price: {
          unit: string
          value: string
        },
        avatar: {
          alt_text: string
          src: string
          description: string
        },
        address: {
          text: string,
          ward: string,
          district: string,
          city: string
        },
        contact: {
          image: string,
          name: string,
          address: string,
          mobile: string,
          phone: string,
          email: string,
        }
        area: {
          unit: string
          value: string
        }
    },
}

interface PostType {
    id: any,
    author:{
        name:string,
        avatar:string,
    },
    created_at:string,
    message:string,
    media:string,
    avatar:string,
    name:string,
    comments:{
        id:any,
        author:{
            avatar:string,
            name:string
        }
        created_at:string,
        message:string,
    }[],
    liked:boolean,
    likes:number,
}

const Project: React.FunctionComponent<ListProjectProps> = (props: ListProjectProps) => {
    const { className, ...rest } = props;
    const classes = useStyles();
    return (
        <div {...rest} className={clsx(classes.root, className)}>
            <h1 className={classes.title}>Hiện tại người dùng chưa đăng dự án nào</h1>
        </div>
    );
};


export default Project;
